import React, { useState } from "react";
import "./Sign_Up.css";
import { Link, useNavigate } from "react-router-dom";
import { API_URL } from "../../config";

const Sign_Up = () => {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");
  const [password, setPassword] = useState("");
  const [errors, setErrors] = useState([]); // Lưu danh sách lỗi
  const navigate = useNavigate();

  // Hàm kiểm tra đầu vào trước khi gửi API
  const validateInputs = () => {
    let validationErrors = [];

    if (!name.trim()) validationErrors.push("Name is required.");
    if (!email.trim()) validationErrors.push("Email is required.");
    else if (!/\S+@\S+\.\S+/.test(email))
      validationErrors.push("Invalid email format.");

    if (!phone.trim()) validationErrors.push("Phone number is required.");
    else if (!/^\d{10}$/.test(phone))
      validationErrors.push("Phone number must be 10 digits.");

    if (!password.trim()) validationErrors.push("Password is required.");
    else if (password.length < 6)
      validationErrors.push("Password must be at least 6 characters.");

    setErrors(validationErrors);
    return validationErrors.length === 0;
  };

  const register = async (e) => {
    e.preventDefault();

    if (!validateInputs()) return;

    try {
      const response = await fetch(`${API_URL}/api/auth/register`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ name, email, phone, password }),
      });

      const json = await response.json();

      if (json.authtoken) {
        sessionStorage.setItem("auth-token", json.authtoken);
        sessionStorage.setItem("name", name);
        sessionStorage.setItem("phone", phone);
        sessionStorage.setItem("email", email);
        navigate("/");
      } else {
        setErrors(
          json.errors ? json.errors.map((err) => err.msg) : [json.error]
        );
      }
    } catch (error) {
      setErrors(["Something went wrong. Please try again later."]);
    }
  };

  return (
    <div className="container" style={{ marginTop: "5%" }}>
      <div className="signup-grid">
        <div className="signup-form">
          <form onSubmit={register}>
            <div className="form-group">
              <label htmlFor="name">Name</label>
              <input
                value={name}
                onChange={(e) => setName(e.target.value)}
                type="text"
                id="name"
                className="form-control"
                placeholder="Enter your name"
              />
            </div>

            <div className="form-group">
              <label htmlFor="email">Email</label>
              <input
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                type="email"
                id="email"
                className="form-control"
                placeholder="Enter your email"
              />
            </div>

            <div className="form-group">
              <label htmlFor="phone">Phone</label>
              <input
                value={phone}
                onChange={(e) => setPhone(e.target.value)}
                type="tel"
                id="phone"
                className="form-control"
                placeholder="Enter your phone number"
              />
            </div>

            <div className="form-group">
              <label htmlFor="password">Password</label>
              <input
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                type="password"
                id="password"
                className="form-control"
                placeholder="Enter your password"
              />
            </div>

            {errors.length > 0 && (
              <div className="error-box">
                {errors.map((err, index) => (
                  <p key={index} className="error-text">
                    {err}
                  </p>
                ))}
              </div>
            )}

            <button type="submit" className="btn btn-primary">
              Sign Up
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Sign_Up;
